const url=new URL(window.location.href),data=new URLSearchParams({path:url.pathname,t:Date.now().toString(),r:Math.random().toString()});navigator.sendBeacon(`/api/analytics/access?t=${new Date().getTime()}`,data),window.addEventListener("beforeunload",()=>{let n=new URL(window.location.href),t=new URLSearchParams({path:n.pathname,t:Date.now().toString(),r:Math.random().toString()});navigator.sendBeacon(`/api/analytics/unload?t=${new Date().getTime()}`,t)});